import { Component } from "react";
export default class BuildForm extends Component {
  render() {
    // Récupérer les données passées via props
    const { data } = this.props;

    return (
      <div>
        <h1>Nom: {data.name}</h1>
        <p>Email: {data.email}</p>
        <p>Date: {data.date}</p>
        <img src={data.photo} alt="User" />
        <p>État local: {this.state.someData}</p>
      </div>
    );
  }
}
